import React from 'react';
import UserForm from './components/UserForm'
import UserList from './components/UserList'

const INITIAL_USERS = [
  {
    key: Math.randomI(),
    name: 'Alan',
    age: 31
  },
  {
    key: '01',
    name: 'Alan',
    age: 31
  },
]

function App() {
  return (
    <div>
      <UserForm />
      <UserList />
    </div>
  );
}

export default App;
